import React, {Component} from "react";
import "./Contact.css";


import aos from 'aos';
import 'aos/dist/aos.css';

aos.init();

class Contact extends Component{
	render() {
		return (
			<div id = "Contact" className = "section">
				<h1 
				data-aos="fade-up"
				data-aos-delay="300"
				data-aos-duration="700"
				data-aos-once="true"
				className = "contactTitle">CONTACT ME</h1>
				<h2 
				data-aos="fade-in"
				data-aos-delay="900"
				data-aos-duration="700"
				data-aos-once="true"
				data-aos-anchor="contactTitle"
				className = "contactDesc">Feel free to ask me anything! <br></br><br></br><contact data-aos="fade-left"
				data-aos-delay="1500"
				data-aos-duration="700"
				data-aos-once="true"
				data-aos-anchor="contactTitle"className = "contact">eltonchang0424@gmail.com<br></br>(408)600-9749</contact></h2>
			</div>
		);
	}
}

export default Contact;
